Khu đô thị Yên Thế Bắc Sơn nằm trên trục đường 30m gồm 2 làn đường riêng biệt là đường Yên Thế và đường Bắc Sơn thuộc Phường Hòa An, Quận Cẩm Lệ, Thành phố Đà Nẵng.

- Phía đông giáp với đường Tôn Đản;

- Phía tây giáp đường Nguyễn Công Hoan nối dài;

- Phía bắc giáp KDC Hòa Phát 3;

- Phía nam giáp đường Đinh Liệt nối ra đường Trường Chinh.


